import { Input, Switch } from 'antd';
import styles from './style.module.scss';
const { TextArea } = Input;


const Banner = (props) => {
    console.log(props, 'props');
    const { attributes = {}, changeTempPageChildAttribute } = props;
    const { myName, description, showSmallPic } = attributes;
    console.log(attributes);
    return (
        <div>
            <div className={styles.row}>
                <span className={styles.label}>小站名字</span>
                <Input
                    value={myName}
                    className={styles.content}
                    placeholder="请输入小站名字"
                    onChange={(e) => { changeTempPageChildAttribute('myName', e.target.value) }}
                />
            </div>
            <div className={styles.row}>
                <span className={styles.label}>小站简介</span>
                <TextArea
                    value={description}
                    className={styles.content}
                    rows={2}
                    placeholder="请输入小站简介"
                    onChange={(e) => { changeTempPageChildAttribute('description', e.target.value) }}
                />
            </div>
            <div className={styles.row}>
                <Switch checked={showSmallPic} onChange={(checked) => { changeTempPageChildAttribute('showSmallPic', checked) }} />
            </div>

        </div>
    )
}

export default Banner;
